function Input({name, type, text, handleOnChange, value}){
    return(
        <>
            <InputLabel htmlFor={name} sx={{ color: theme.palette.primary.main }}>{text}:</InputLabel>
                <Input 
                    id={name} 
                    name={name} 
                    type={type}
                    value={value}
                    aria-describedby="my-helper-text"
                    onChange={handleOnChange}
            />
        </>
    )
}
export default Input
